pragma solidity ^0.8.7;

//import statements

//interfaces

//libraries

contract SharedWallet {

//Type declarations
    struct BeneficiaryDetails {
        uint allowance;
        uint claimsMade;
    }

//State variables
    //uint public walletBalance;    //aggregate wallet balance
    address public owner;    //will have permission to withdraw any amount
    mapping(address => BeneficiaryDetails) public beneficiaries;    //holds benficiary details by address
    uint public totalAllowances;    //total allowances allocated as a %
    uint public totalClaims;    //total claims made to date
    uint public contractBalance; //total balance in contract


//Events
    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "You are not allowed - only the owner can do this.");
        _;
    }

//Functions

    //anyone can send to wallet
    function SendMoney() public payable {
        contractBalance = address(this).balance;
    }

    //beneficiaries can withdraw share of total funds to date in accordance with allocation
    function ClaimMoney(address payable _to, uint _amount) public {
        require(msg.sender != owner, "The owner should use ownerWithdraw function");
        require(address(this).balance > 0, "There is no money in the wallet to claim");
        require(beneficiaries[msg.sender].allowance > 0,"You do not have any allowance");
        uint fullAllowance = beneficiaries[msg.sender].allowance * (address(this).balance + totalClaims)/100;
        uint allowanceRemaining = 0;    //initialises only
        if (fullAllowance > beneficiaries[msg.sender].claimsMade) {
            allowanceRemaining = fullAllowance - beneficiaries[msg.sender].claimsMade;
        }
        require(_amount <= allowanceRemaining, "The amount is too high");
        beneficiaries[msg.sender].claimsMade += _amount;
        totalClaims += _amount;
        contractBalance = address(this).balance - _amount;
        _to.transfer(_amount);
    }

    //owner can set who gets an allowance
    function SetAllowance(address _beneficiary, uint _allowancePercentage) public onlyOwner {
        require(_beneficiary != owner, "An allowance is not required for the owner");
        require(beneficiaries[_beneficiary].allowance == 0, "The address already has an allowance");
        require(totalAllowances + _allowancePercentage <= 100,"This would over-allocate the allowances");
        beneficiaries[_beneficiary].allowance = _allowancePercentage;
        totalAllowances += _allowancePercentage;
    }

    //owner can withdraw as much as desired
    function ownerWithdraw(address payable _to, uint _amount) public onlyOwner {
        require(_amount <= address(this).balance,"Amount is larger than contract balance");
        contractBalance = address(this).balance - _amount;
        _to.transfer(_amount);
    }
}


